@Ninja Nerd would breathing eucalyptus steam create a hostile environment in the lungs so as to help prevent the covid 19 virus from attaching and proliferating? Experiencing has proven it to be effective in preventing my lungs from filling with mucus to be coughed up for weeks to follow when contracting influenza, so I'm wondering if it could help with vivid 19. I also heard colloidal silver used with a nebulizer can help prevent complications from covid 19. 
Also, would having the nasal passages lined with eucalyptus oil cause a false negative with the current test for this Coronavirus?
I'd love to hear your thoughts from scientific perspective.

